import OpenCourse from "../pages/OpenCourse";
import {Link} from "react-router-dom";
import Spider from "../img/SPIDER.jpg"

const CourseTiles=()=>{
    return(

        <Link to="/OpenCourse" >
        <div className="flex m-4 flex-row">
            <div className="flex h-20 w-72">
                
            </div>
            <div className=" flex border-white h-20 w-72  bg-black">
                <img src={Spider}></img>
            </div>
            

        </div>
        </Link>
        
        
    )
}

export default CourseTiles;
